import React, { useState } from 'react';
import { Form ,Col, Container} from 'reactstrap';
import '../styles/admin.css';
function Admin() {

 

  const [showAddTourDetails, setShowAddTourDetails] = useState(true);
  

  function handleAddTourButtonClick() {
    setShowAddTourDetails(true);
  }

  function handleDeleteTourButtonClick() {
    setShowAddTourDetails(false);
  }
  
  

  return (
    <Container>
        <Col>
    <div>
      <h1>Tour Details Page</h1>
      {showAddTourDetails ? <AddTourDetailsForm /> : <DeleteTourDetailsButton />}
      <div>
        <button onClick={handleAddTourButtonClick}>Add Tour Details</button>
        <button onClick={handleDeleteTourButtonClick}>Delete Tour Details</button>
      </div>
    </div>
    </Col>
    </Container>
  );
}

function AddTourDetailsForm() {
  // Render the form to add tour details
  const [title, setTitle] = useState("");
  const [city, setCity] = useState("");
  const [address, setAddress] = useState("");
  const [distance, setDistance] = useState(0);
  const [price, setPrice] = useState(0);
  const [maxGroupSize, setMaxGroupSize] = useState(0);
  const [desc, setDesc] = useState("");
  const [photo, setPhoto] = useState("");
  const [featured, setFeatured] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    const newTour = {
      title,
      city,
      address,
      distance,
      price,
      maxGroupSize,
      desc,
      reviews: [],
      photo,
      featured,
    };
    console.log(newTour);

    fetch('http://localhost:4000/api/v1/tours', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(newTour),
    })
      .then(response => response.json())
      .then(data => {
        console.log('Success:', data);
        // TODO: Add some feedback to the user that the tour was added successfully
      })
      .catch((error) => {
        console.error('Error:', error);
        // TODO: Add some feedback to the user that there was an error adding the tour
      });
  };

  return (
    <Form  className="form-container" onSubmit={handleSubmit}>
      <div className="form-input">
      <label className="form-label">
        Title:
        <input type="text" value={title} onChange={(e) => setTitle(e.target.value)} />
      </label>
      <label className="form-label">
        City:
        <input type="text" value={city} onChange={(e) => setCity(e.target.value)} />
      </label>
      <label className="form-label">
        Address:
        <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} />
      </label>
      <label className="form-label">
        Distance:
        <input type="number" value={distance} onChange={(e) => setDistance(e.target.value)} />
      </label>
      <label className="form-label">
        Price:
        <input type="number" value={price} onChange={(e) => setPrice(e.target.value)} />
      </label>
      <label className="form-label">
        Max Group Size:
        <input type="number" value={maxGroupSize} onChange={(e) => setMaxGroupSize(e.target.value)} />
      </label>
      <label className="form-label">
        Description:
        <textarea value={desc} onChange={(e) => setDesc(e.target.value)} />
      </label>
      <label className="form-label">
        Photo:
        <input type="text" value={photo} onChange={(e) => setPhoto(e.target.value)} />
      </label>
      <label className="form-label">
        Featured:
        <input type="checkbox" checked={featured} onChange={(e) => setFeatured(e.target.checked)} />
      </label>
      <button className="form-submit-btn" type="submit">Add Tour</button>
      </div>
    </Form>
  );
}





function DeleteTourDetailsButton() {
  // Render the button to delete tour details
  return (
    <div>
      <h2>Delete Tour Details</h2>
      <button>Delete Tour</button>
    </div>
  );
}



export default Admin;
